$(document).ready(function(){

	/*Profile popup toggle*/
	$(function(){
  		$(".top-nav p").click(function(){
  			$(".profile-popup").addClass("show");
  		});
  	});

	$(function(){
  		$(".profile-popup .fa-times").click(function(){
  			$(".profile-popup").removeClass("show");
  		});
  	});

	/* Automatically tick checkboxes */
  	$('#std-list').change(function(){
  		var student_id = $(this).find(":selected").val();
  		var dataString = 'std_id='+student_id;
  		$.ajax({
			url: 'http://localhost/portal/submission/reload-records-ajax.php',
			dataType: "json",
			data: dataString,
			cache: false,
			success: function(courseCodes){
				$(".courseChk").prop('checked', false);
				$.each(courseCodes,function(i, item){
					$(".courseChk").each(function(){
						if ($(this).val() == item.course_code){
							$(this).prop('checked', true);
						}
					});
				});
			}
  		});
  	});
 });